INSERT INTO `movement` VALUES (1,'杠铃翻举','肩,背,小臂,大腿','','Barbell Clean Movement for strength training or CrossFit',1),(2,'深蹲','大腿,小腿','','Squart',1),(3,'硬拉','背,大腿,小腿','','Deadlift',1),(4,'体前深蹲','背,大腿','','Front Squart',1),(5,'哑铃弓箭步','大腿,小腿','','Dumbbell Walking Lunge',0),(6,'卧推','肩,胸,三头','','Bench Press',1),(7,'杠铃划船','背,二头','','Barbell Row',1),(8,'站姿杠铃上举','肩,三头','','Overhead Barbell Press',1),(9,'杠铃曲臂','二头,小臂','','Barbell Biceps Curl',1),(10,'上斜板哑铃卧推','胸,三头','','Incline Dumbbell Bench Press',0),(11,'双杠曲臂','肩,胸,三头','','Dip',0),(12,'上斜板杠铃卧推','胸,三头','','Barbell version of incline bench press',1),(15,'杠铃耸肩','肩,背','','Stand up straight with your feet at shoulder width as you hold a barbell with both hands in front of you using a pronated grip (palms facing the thighs). Tip: Your hands should be a little wider than shoulder width apart. You can use wrist wraps for this exercise for a better grip. This will be your starting position.\nRaise your shoulders up as far as you can go as you breathe out and hold the contraction for a second. Tip: Refrain from trying to lift the barbell by using your biceps.\nSlowly return to the starting position as you breathe in.\nRepeat for the recommended amount of repetitions',1),(17,'哑铃耸肩','肩,背','','Stand erect with a dumbbell on each hand (palms facing your torso), arms extended on the sides.\nLift the dumbbells by elevating the shoulders as high as possible while you exhale. Hold the contraction at the top for a second. Tip: The arms should remain extended at all times. Refrain from using the biceps to help lift the dumbbells. Only the shoulders should be moving up and down.\nLower the dumbbells back to the original position.\nRepeat for the recommended amount of repetitions.',0),(18,'反手引体向上','背,二头','','To begin, stand on an exercise band so that tension begins at arm length. Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width. The handles should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight. This will be your starting position.\nUse your side shoulders to lift the handles as you exhale. The handles should be close to the body as you move them up. Continue to lift the handles until they nearly touches your chin. Tip: Your elbows should drive the motion. As you lift the handles, your elbows should always be higher than your forearms. Also, keep your torso stationary and pause for a second at the top of the movement.\nLower the handles back down slowly to the starting position. Inhale as you perform this portion of the movement.\nRepeat for the recommended amount of repetitions.',0),(20,'交替上斜板曲臂','二头,小臂','','Sit down on an incline bench with a dumbbell in each hand being held at arms length. Tip: Keep the elbows close to the torso.This will be your starting position.\nWhile holding the upper arm stationary, curl the right weight forward while contracting the biceps as you breathe out. As you do so, rotate the hand so that the palm is facing up. Continue the movement until your biceps is fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps. Tip: Only the forearms should move.\nSlowly begin to bring the dumbbell back to starting position as your breathe in.\nRepeat the movement with the left hand. This equals one repetition.\nContinue alternating in this manner for the recommended amount of repetitions.',0),(24,'杠铃牧师凳曲臂','二头,小臂','','Place a preacher bench about 2 feet in front of a pulley machine.\nAttach a straight bar to the low pulley.\nSit at the preacher bench with your elbow and upper arms firmly on top of the bench pad and have someone hand you the bar from the low pulley.\nGrab the bar and fully extend your arms on top of the preacher bench pad. This will be your starting position.\nNow start pilling the weight up towards your shoulders and squeeze the biceps hard at the top of the movement. Exhale as you perform this motion. Also, hold for a second at the top.\nNow slowly lower the weight to the starting position.\nRepeat for the recommended amount of repetitions.',1),(25,'窄距硬拉','背,腹','','Sumo DeadLift',1),(26,'坐姿哑铃上举','肩,三头','','坐姿哑铃上举',0),(27,'坐姿杠铃上举','肩,三头','','坐姿杠铃上举',1);
